import React from 'react'
import "./featuredProporties.css"

function FeaturedProporties() {
  return (
    <div className='fp'>
      <img src="" alt="" className="fpImg" />
      <span className="fpName">The Oberoi</span>
      <span className="fpCity"></span>
      <span className="fpPrice"></span>
    </div>
  )
}

export default FeaturedProporties
